"url:webview/utils/templates/chrome_support.html":'\x3cdiv\x3e\n\x3cp\x3eSimulink Web View cannot be viewed in Google Chrome because of local file security restrictions.  To allow local file access, try the following:\x3c/p\x3e\n\x3ch4\x3eMicrosoft Windows\x3c/h4\x3e\n\x3col\x3e\n\x3cli\x3eClick on the Windows start button and search for "Chrome"\x3c/li\x3e\n\x3cli\x3eRight-click and drag "Google Chrome" search result to an open area.  Select "Create shortcuts here".\x3c/li\x3e\n\x3cli\x3eRight-click the newly created "Google Chrome" shortcut and select properties.\x3c/li\x3e\n\x3cli\x3eClick the "Shortcut" tab.\x3c/li\x3e\n\x3cli\x3eIn the target edit box, append "--allow-file-access-from-files", with no quotes.\x3c/li\x3e\n\x3cli\x3eClick OK to dismiss property dialog.\x3c/li\x3e\n\x3cli\x3eVerify Google Chrome is no longer running.\x3c/li\x3e\n\x3cli\x3eDouble-click on the newly created shortcut to start Google Chrome.\x3c/li\x3e\n\x3c/ol\x3e\n\x3ch4\x3eMacintosh\x3c/h4\x3e\n\x3col\x3e\n\x3cli\x3eRun Terminal.app.\x3c/li\x3e\n\x3cli\x3eType "open /Applications Google\\ Chrome.app --allow-file-access-from-files", with no quotes.\x3c/li\x3e\n\x3c/ol\x3e\n\x3ch4\x3eLinux\x3c/h4\x3e\n\x3col\x3e\n\x3cli\x3eStart terminal.\x3c/li\x3e\n\x3cli\x3eType "./chromium-browser --allow-file-access-from-files", with no quotes.\x3c/li\x3e\n\x3c/ol\x3e\n\x3c/div\x3e',
